import React from 'react'

const App = () => {
  const course = {
    id: 1,
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10,
        id: 1
      },
      {
        name: 'Using props to pass data',
        exercises: 7,
        id: 2
      },
      {
        name: 'State of a component',
        exercises: 14,
        id: 3
      }
    ]
  }

  return (
  <ul>
    {course.parts.map(c => 
      <Course key={course.id} course={c}/>
      )}
  </ul>) 
}

const Course = ({course}) => {
  return (
    <p>{course.name} {course.exercises}</p>
  )
}
export default App
